import React from 'react'
import {Col, Container, Row} from 'react-bootstrap'
import MyNavbar from './MyNavbar'

class Page extends React.Component {

	updateParent;

	constructor(props) {
		super(props);
		this.updateParent = props.update;
	}

	render() {
		return (
			<React.Fragment>
				<MyNavbar update={this.updateParent}/>
				<br/>
				<Container>
					<Row>
						<Col/>
						<Col md={10}>{this.props.children}</Col>
						<Col/>
					</Row>
				</Container>
			</React.Fragment>
		);
	}
}

export default Page;
